WOMT_aTexte['popup_faq_3_text'][0]='Das ist eine schwierige Frage. Wer entscheidet, welche Themen wichtig sind und welche nicht? Die Regierung, die Parteien, die Medien und die Bürger haben dazu sehr unterschiedliche Meinungen. Bei der Auswahl der Thesen für unseren Wahl-O-Mat bezogen wir uns vor allem auf jene Themen, zu denen die Parteien unterschiedliche Meinungen haben und die besonders auch für junge Menschen von Interesse sind. Leider sind während des Entstehungsprozesses auch "gute" Thesen aus dem Wahl-O-Mat gefallen. Dies kam vor, weil Thesen von einzelnen Parteien nicht eindeutig mit stimme zu / stimme nicht zu / neutral beantwortet wurden oder weil die Parteipositionen in dieser These keine Unterscheidung zwischen den Parteien ermöglichten. Wir haben Interesse an Ihrer Meinung. Schicken Sie uns Ihre Überlegungen zu, am besten unter: <a tabindex="31" title="" class="link_normal" href="mailto:info@wahl-o-mat.de">info@wahl-o-mat.de</a>';
