WOMT_aTexte['popup_faq_8_text'][0]='Auf der Seite, die Sie von Ihrem Wahl-O-Mat Ergebnis durch einen Klick auf "weiter" oder "Wie begründen die Parteien ihre Antworten" erreichen, können Sie sich noch einmal durch alle Thesen des Wahl-O-Mat durchklicken. Neben Ihrem Votum sehen Sie auch die Antworten der Parteien bzw. Wählervereinigungen ("stimme zu" = Häkchen, "stimme nicht zu" = Kreuz, "neutral" = Minuszeichen). Mit einem kurzen Klick auf den Namen der jeweiligen Partei zeigt Ihnen der Wahl-O-Mat die Begründung der Partei für ihr Antwortverhalten zu der entsprechenden These an.';
