WOMT_aTexte['popup_impressum_text_dspartner'][0]='<h1 class="orange">Datenschutzerklärung</h1><p>Diese Version läuft bei einem Medienpartner des Wahl-O-Mat auf den Servern des Partners. Für den Datenschutzhinweis wenden Sie sich bitte an den [PARTNER_DATENSCHUTZ].<br/><br/><b>Medienpartner</b><br/>Der Wahl-O-Mat wird auch von Medienpartnern der bpb auf deren eigenen Servern betrieben. Um die Eingaben der Nutzer auf den Seiten der Medienpartner zu schützen, sind die Medienpartner vertraglich dazu verpflichtet, Daten über das Nutzungsverhalten der Wahl-O-Mat-Nutzer (z.B. Logfiles) weder auszuwerten, noch zu veröffentlichen oder solche Daten an Dritte für die genannten Zwecke weiterzureichen. Die bpb übernimmt keine Verantwortung für die Datenschutzrichtlinien der Medienpartner.<br/><br/>Medienpartner der bpb teilen der bpb lediglich täglich die Zahl der insgesamt erfolgten Nutzungen des Wahl-O-Mat auf deren Servern mit, die in die Nutzungsstatistik auf <a tabindex="102" title="www.wahl-o-mat.de (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.wahl-o-mat.de" target="_blank">www.wahl-o-mat.de</a> eingehen.<br/><br/><b>Europavergleich</b><br/>Nachdem Sie Ihr Wahl-O-Mat Ergebnis erhalten haben, können Sie nun errechnen lassen, zu welchem Ergebnis Ihre Antworten in anderen europäischen Ländern führen würden. Diese Auswertung findet auf den Seiten unseres niederländischen Partners <a tabindex="102" title="ProDemos (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://prodemos.nl/" target="_blank">ProDemos - Huis voor democratie en rechtsstaat</a> statt. Dazu werden Sie auf den Server von ProDemos weitergeleitet und Ihre Antworten auf die 15 mit einem * markierten Thesen an diesen Server weitergereicht. Für die Einhaltung des Datenschutzes auf dem Server von ProDemos ist ProDemos verantwortlich.<br/><br/>Bonn, den 28. April 2014</p>';
