WOMT_aTexte['popup_faq_10_frage']=new Array();
WOMT_aTexte['popup_faq_10_frage'][0]='Was passiert im Vote Match Europe?';
WOMT_aTexte['popup_faq_10_text']=new Array();
WOMT_aTexte['popup_faq_10_text'][0]='Die Bundeszentrale für politische Bildung/bpb hat sich mit 13 weiteren europäischen Institutionen vernetzt, die in ihren Ländern Wahl-O-Mat ähnliche Tools für nationalen Wahlen online stellen. Gemeinsam haben wir "Vote Match Europe 2014" gegründet und damit 14 "Vote Matches" zusammengeschlossen<br/><br/>Nachdem Sie den Wahl-O-Mat gespielt haben, können Sie Ihre Antworten mit denen der deutschen Parteien vergleichen und herausfinden wie hoch die Übereinstimmung zwischen Ihren und den Antworten der Parteien ist.<br/><br/>Mit nur einem weiteren Klick können Sie 15 der 38 Wahl-O-Mat Thesen, die mit einem Sternchen gekennzeichnet sind, mit den Parteiantworten aus den anderen Ländern vergleichen. Diese 15 Thesen wurden von den Parteien in den teilnehmenden Ländern zuvor beantwortet.';
